  // const out = np.zeros(mask.shape.concat(3), 'float32')
  let r = np.zeros([scale])
  let g = np.zeros([scale])
  let b = np.zeros([scale])

  // mask = (0 < h) & (h < 1)
  let mask = getMaskFirst(scale)
  // const c = 255
