  // r[mask] = c
  r = c.where(mask, r)
  // g[mask] = x[mask]
  g = x.where(mask, g)

  // mask = (1 <= h) & (h < 2)
  mask = getMaskN(scale, 2)
  // r[mask] = x[mask]
  r = x.where(mask, r)
  // g[mask] = c
  g = c.where(mask, g)

  //mask = (2 <= h) & (h < 3)
  mask = getMaskN(scale, 3)
  // g[mask] = c
  g = c.where(mask, g)
  // b[mask] = x[mask]
  b = x.where(mask, b)

  // mask = (3 <= h) & (h < 4)
  mask = getMaskN(scale, 4)
  // g[mask] = x[mask]
  g = x.where(mask, g)
  // b[mask] = c
  b = c.where(mask, b)

  // mask = (4 <= h) & (h < 5)
  mask = getMaskN(scale, 5)
  // r[mask] = x[mask]
  r = x.where(mask, r)
  // b[mask] = c
  b = c.where(mask, b)

  // mask = 5 <= h
  mask = getMaskLast(scale)
  // r[mask] = c
  r = c.where(mask, r)
  // b[mask] = x[mask]
  b = x.where(mask, b)

  return np.stack([r, g, b]).transpose([1, 0])
